import React, { Component } from 'react';
import moment from 'moment';
import './Home.css';
import HomeHeader from '../Header/HomeHeader'
import AssignmentIndIcon from '@material-ui/icons/AssignmentInd';
//import DashboardNav from '../Header/dashbordNav';
import Footer from '../Footer/Footer'
import axios from 'axios'
class HomePage extends Component {
constructor() {
super();
this.state = {
username: 'rahdesai7@gmail.com',
password: 'Rpqb@123',
error: '',
};
this.handlePassChange = this.handlePassChange.bind(this);
this.handleUserChange = this.handleUserChange.bind(this);
this.handleSubmit = this.handleSubmit.bind(this);
this.dismissError = this.dismissError.bind(this);
}

dismissError() {
this.setState({ error: '' });
}
handleSubmit(evt) {
evt.preventDefault();
if (!this.state.username) {
return this.setState({ error: 'Username is required' });
}
if (!this.state.password) {
return this.setState({ error: 'Password is required' });
}
return this.setState({ error: '' });
}
handleUserChange(evt) {
this.setState({
username: evt.target.value,
});
};
handlePassChange(evt) {
this.setState({
password: evt.target.value,
});
}
handleRegister = () => {
  this.props.history.push('/Signup')
}
onPost = () => {

  this.props.history.push('/RaisePO')
}

onDelete = () => {
  this.props.history.push('/Delete')
}

onGet = () => {
  console.log("onGetToken----->")
  this.props.history.push('/Get')
}

onlogout = () => {
  this.props.history.push('/login')
}
onPostHome = () => {
 alert("You are already in Home Page")
}

render() {
// NOTE: I use data-attributes for easier E2E testing
// but you don't need to target those (any css-selector will work)
return (
  <div >
    {/* <DashboardNav/> */}
  <HomeHeader 
  click={() => this.onPost()} 
  clickhome={() => this.onPostHome()}
  clickget={() => this.onGet()}
  clickdelete={() => this.onDelete()}
  logout={() => this.onlogout()} 
  />
{/* <h1 className="Home">This is Bank Dashbord</h1> */}
<Footer/>
<div className="row clearfix" style={{marginTop:'22px'}}>
                <div className="col-lg-6 col-md-6">
                  <div className="dashboard-card top_counter">
                    <div className="body">
                      <div className="icon xl-slategray">
                        <i className="zmdi zmdi-account" />{' '}
                      </div>
                      <div className="content">
                        <div className="text rowlist">New Patients</div>
                        <h5 className="number rowlist">
                          <strong>90</strong>
                        </h5>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="col-lg-6 col-md-6">
                  <div className="dashboard-card top_counter">
                    <div className="body">
                      <div className="icon xl-slategray">
                        <i className="zmdi zmdi-account" />{' '}
                        <AssignmentIndIcon/>
                      </div>
                      <div className="content">
                        <div className="text rowlist">Today's Appointments</div>
                        <h5 className="number rowlist">
                          <strong>{moment().format('D')}</strong>
                        </h5>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
</div>
);
}
}
export default HomePage;
